import React from "react";

function App() {
  // <a href="https://www.vecteezy.com/video/2020679-singapore-skyline-at-night"
  const src =
    "https://www.vecteezy.com/video/2020679-singapore-skyline-at-night";
  return (
    <video controls width="100%">
      <source src={src} type="video/mp4" />
      Sorry, your browser doesn't support embedded videos.
    </video>
  );
}

export default App;
